import React from 'react';
//import { faCode, faHighlighter } from '@fortawesomefree-solid-svg-icons';
import { FontAwesomeIcon } from "@fortAwesome/react-fontawesome"
import { faPhone } from '@fortawesomefree-brands-svg-icons';

const TicketsFilter = ({ chooseCheap }) => {

  return (
    <div className="tickets-filter">
        <button onClick={chooseCheap}>САМЫЙ ДЕШЕВЫЙ</button>
        <button>САМЫЙ БЫСТРЫЙ</button>
        <button>ОПТИМАЛЬНЫЙ</button>
        <FontAwesomeIcon icon={faPhone} />
    </div>
  )
}

export default TicketsFilter;
